INSERT INTO `episodes` VALUES ('6288f49e4b1e678048a821e18b51ca23','0017f938f6222cff4ddf840b193fa381',8,'Who Rules the Land of Denial?',NULL,'Nikki struggles to survive; Emmit gets spooked; Sy joins Varga for tea.',NULL),('c9bb9c73b7af5b6092c4b01a1d1e5747','00ea59d44545e3e5e16ecd4d3687962b',6,'Girl on Fire',NULL,'Maine doesn\'t seem to be himself. But the team has bigger fish to fry: They must race against time to extract vital information from their prisoner.',NULL),('7fe2b63727cb33ea372831821b418edd','01fb70f076ffc0aac5bb9a68210edfdc',8,'The Instant White-Hot Wild',NULL,'Calling all patriots! Let\'s show Homelander we\'ve got his back and we\'re not going to let Starlight and her House of Horrors get away with trafficking children and drinking their adrenaline! It\'s time for real Americans to fight back! Join the Hometeamers and Stormchasers tomorrow at Vought Square! Stand back and stand by!',NULL),('1adcca458d51bd79636afa8631eaac1a','026ee866c1b0bd3d6d5a5d8e08e72f32',6,'Pretend Daddy',NULL,'The aftermath of a birthday party causes Nathan to re-evaluate his entire project.',NULL),('9f46394252e21a14fcfacf1d5fce8c5b','02c3ee91e6b798959c0136ce7d305206',2,'A Damned Man',NULL,'Stede battles feelings of guilt while hunting for missing hostages. Lucius makes a surprising discovery.',NULL),('06d23249bd626297328fec95553a2597','02ef4d9f8e80672dd895119641cc989d',9,'All Monsters Attack',NULL,'After receiving bad news from home, Abbi attempts to replicate the cure. Juan attends a party. Tilda tries to warn Sarkov of the risks of using nanobots.',NULL),('c25d88acc0a04d27318f4bf425f9619e','03ef4579cc56b4bee2c849148d944761',6,'The Next Episode',NULL,'On Halloween, Jules starts exhibiting concerning behavior; McKay questions his future in football; Cassie spends some time with Daniel; Kat continues to push Ethan away; Nate comes up with a plan.',NULL),('7c707671b4d78ee52845e4f99ed2451d','04a679806058d52a044bee0953d92169',8,'Gliding Over All',NULL,'Walt expands his business overseas, and the money is pouring in.',NULL),('487b0f546e89568b8868b9392b12c8fa','04ccd93d73d63e99c8cf4c65c655dad3',10,'The Gold Coast',NULL,'Marty makes plans without telling Wendy. Darlene sends a message via Jonah. Wyatt learns the truth about his dad. Ruth realizes Cade must be stopped.',NULL),('ba6929a18653f4f28071a40ac01bb12b','04dcaee474fd46f4d74c642072461a92',7,'Computer Repair / Psychic',NULL,'Nathan helps a computer repair shop earn the public\'s trust, and a psychic\'s marketing turns personal.',NULL),('b6f011caf4141f05b8e7d29814348732','04eddaab6dd730f16f98738320982d29',5,'Bottled Appetites',NULL,'Heedless of warnings, Yennefer looks for a cure to restore what she\'s lost. Geralt inadvertently puts Jaskier in peril. The search for Ciri intensifies.',NULL),('4f9a710a1cff57ba5c0990658f9b0be7','04f2e505912a90bc9d4555de071cd820',10,'Morton\'s Fork',NULL,'Molly takes the lead, while Gus pursues a hunch. Lester manipulates a situation, and Malvo finds a new target.',NULL),('0539233281207ccb85774270be7723e8','079453a95a429a71ba276f25eb1a2268',7,'The Theater and Its Double',NULL,'Art imitates life as the East Highland crew watches their complicated dynamics reflected in Lexi\'s long-awaited play.',NULL),('5c5f8e66ac662642d218e4c13fd5ad42','08601cbb83d77dd684c811661514f9f7',1,'Episode 1',NULL,'Thomas Shelby plans to fix a horse race; some guns turn up stolen.',NULL),('bcb1698c4ad595eabff5c9662b05c401','0864b1e06ab14ba716f65c536808f12c',9,'The Castle',NULL,'In an attempt to stop the Kansas City mob, the police decide to use Ed and Peggy as bait. Hanzee betrays the Gerhardts and takes revenge.',NULL),('39fd70e7880c97d1d311085a9979f935','08955871cbb39eb0b8a1dbbcdd7d6457',10,'Happy',NULL,'Loy forms an uneasy alliance, Odis finds peace, Josto settles the score, Ethelrida takes a risk and Oraetta gets spooked.',NULL),('4f9a710a1cff57ba5c0990658f9b0be7','0905fef755a7131b8c8e5ce95e0f2a8e',3,'A Muddy Road',NULL,'Malvo flips the script on the blackmail operation. Molly sets a trap, and Gus debates whether he should come clean. Lester\'s return to work has complicated repercussions.',NULL),('487b0f546e89568b8868b9392b12c8fa','0910f85e14e905a8cc416f81e00b330b',5,'Game Day',NULL,'Agent Petty\'s revelation tests the loyalties of Marty, Ruth and the cartel. Despite the FBI closing in, the Snells refuse to destroy their poppies.',NULL),('7fe2b63727cb33ea372831821b418edd','098a652336ecfeb61997a91f59109cf7',2,'The Only Man in the Sky',NULL,'Homelander, America\'s greatest Supe. Defending our shores from sea to shining sea. Today, America honors him on his birthday. Vought Shopping Network is celebrating by offering an exclusive Homelander Limited Birthday Edition Gold Coin.',NULL),('8306799d1deead7f0e0505118a8d861f','0a143967e722a1bff293768e53cb98d4',4,'Gas Station/Caricature Artist',NULL,'Nathan helps an independent gas station by devising the world\'s greatest rebate. He also attempts to make a fledgling caricature artist famous.',NULL),('04aea369458f234ff90282a5d44b02aa','0a84aa6439dba46337fa0e930dbb97d1',4,'Nothing Like It in the World',NULL,'Milk, Hughie, and Annie go on a road trip to find Liberty. Frenchie has relationship problems, and Homelander continues to unravel.',NULL),('b3c9a42f45391bf6dd68037c00cdbad5','0ad4c0a5be802b3d120c0c1570650e36',5,'Episode 5',NULL,'The Peaky Blinders are under attack. Tommy\'s power base in London is obliterated, and both Arthur and Michael are arrested and imprisoned.',NULL),('bcb1698c4ad595eabff5c9662b05c401','0b95f0d23a8f8bf04f959075a3856eb8',1,'Waiting for Dutch',NULL,'In a small Minnesota town, a shooting at a diner disrupts the lives of a state officer, a married couple, and a North Dakota crime syndicate.',NULL),('854212de47a60a6be3fd2d69e50af097','0c323b5977d3a374caf8167149b4cd70',4,'Chapter Four: The Sauna Test',NULL,'A code red brings the gang back together to face a frighteningly familiar evil. Karen urges Nancy to keep digging, and Robin finds a useful map.',NULL),('1fb0aac48948321f45cb5eaf2396c34c','0c40bee402c7e1b9174f74efcf95db6c',8,'Better Call Saul',NULL,'Badger is caught by the DEA. Walt and Jesse hire the best criminal lawyer in town, Saul Goodman.',NULL),('06d23249bd626297328fec95553a2597','0cc351ed43939088c9d675b4b26288b0',10,'Destroy All Monsters',NULL,'Abbi and Tilda band together with an unexpected ally to go after Sarkov, who has big plans for Juan. New revelations bring new challenges for the group.',NULL),('958c6bd787a266c1065b1cab2bd7b9aa','0cc559104cb5a81013f37dfc4b0ccccb',1,'Free at Last',NULL,'In the aftermath of a massive military effort to take Pablo into custody, the family reunites while enemies worry. Steve and Connie fight about safety.',NULL),('8a27a3b4f6476624da06a41a0c5c6a1c','0d16eb7a4d97c5704a062618fb7f72ae',1,'Sidekicks',NULL,'This is the sidekicks anthem!',NULL),('f5725c07d1082b0a4d5780e144418a39','0d327531a1bdf209a3ba8ec6bf386df3',6,'Episode 6',NULL,'As Tommy prepares to commit the most audacious crime of his career, an unexpected blow forces him to face his worst fears in a race against time.',NULL),('212ce6c80f9d052702117bd5ac837cde','0e2f974a217285fce8552fc146ae9b24',1,'Nosedive',NULL,'A woman desperate to boost her social media score hits the jackpot when she\'s invited to a swanky wedding, but the trip doesn\'t go as planned.',NULL),('c999419dd22bb58f245fb8bcba667094','0eaf4b688f8f1a1e6cc1c61d9c918440',9,'Episode 9',NULL,'',NULL),('fc7791b9faed8d32191f9d6028dfce1a','0fafd52359831cbf1db2d344808ca4fb',4,'Sapphire',NULL,'Tommy establishes a connection between crime and political power that could alter the course of history. He also receives life-changing news from an unexpected source.',NULL),('654dbd1b78544d038c533390fa91caca','102a0d3320954915b8fd53e0e99a53b4',2,'New Beginnings',NULL,'Kayce and Rip come to blows; Beth starts buying up land to protect the ranch; Monica begins a new chapter at the university.',NULL),('04fe07030df369040f1f39dd4695f01d','103841d4434f223bb54d50cca7565a6f',4,'The Long Black Train',NULL,'A se