andle Los Pepes.',NULL),('a5de20457d8264ee24cafeb01f951b71','ab4aa3d0b93c64e803727f8ccfadbae0',9,'Fire Pink',NULL,'Ben\'s confrontation with Helen and Erin sends the Byrdes into crisis mode. Meanwhile, Sam\'s concerns about the FBI inspire little sympathy.',NULL),('f13fa9d7506235f6160792767834cf4a','ab92ba1d3986d5b5f51940ec51a94921',1,'Electronics Store',NULL,'Nathan faces off against a big corporation in an attempt to help a struggling electronics store.',NULL),('c91cf3f2f7d00f77450b4dd2b5fb3c6b','abff7c44bcae232b66af144ec6dee1ca',7,'One Minute',NULL,'Jesse ends up in the hospital after getting beaten up by Hank. Now he is threatening to press charges against the DEA. To stop him, Walt decides to bring Jesse on as his partner, once again.',NULL),('c1ce9516f6bd3a58609d8fba23f661ca','ac8b497d40983e9df7c48850408a0272',2,'Chapter Two: The Weirdo on Maple Street',NULL,'Mike hides the mysterious girl in his house. Joyce gets a strange phone call.',NULL),('39a7a77ddda8f50369ff912f3da245f8','aceb52846123889a6b49525772f147a5',6,'Chapter Six: The Spy',NULL,'Will\'s connection to a shadowy evil grows stronger but no one\'s quite sure how to stop it. Elsewhere, Dustin and Steve forge an unlikely bond.',NULL),('04aea369458f234ff90282a5d44b02aa','ad3562cbe622e27efbac9573c47a6dc1',8,'What I Know',NULL,'Becca shows up on Butcher\'s doorstep and begs for his help. The Boys agree to back Butcher, and together with Starlight, they finally face off against Homelander and Stormfront. But things go very bad, very fast.',NULL),('f5725c07d1082b0a4d5780e144418a39','ae30588c7aba21284b7a0758e435f43a',2,'Episode 2',NULL,'Tommy discovers the extent of the mission given to him and the extreme lengths his new paymasters are willing to go to in their quest for power. Meanwhile his own family\'s activities lead to escalating danger in Birmingham.',NULL),('1fb0aac48948321f45cb5eaf2396c34c','af32361c0e64692afba7ba99a9394ed9',3,'Bit by a Dead Bee',NULL,'Walt and Jesse try to come up with alibis for their disappearances.',NULL),('5815d1e65566e71e538f3a13dd26044e','af65be1cdf006fa6989fa65e712a9e00',3,'Follow the Money',NULL,'The Rodr√≠guez brothers are hiding during the negotiations. Pacho meets the Lord of the Heavens in Mexico. Pe√±a\'s new DEA team visits Cali.',NULL),('e2ac8ed4d6497359255904150147a1be','af6d67cfdc4f62acdc2384e309c2ccca',6,'Carlsbad Crazies',NULL,'Marvyn regresses back to his old ways while defending Louise from an opposing team\'s harassment. Holly gets a shot at the limelight.',NULL),('c91cf3f2f7d00f77450b4dd2b5fb3c6b','afa6e7dfc5ceef9ae041a295ec6a31ab',13,'Full Measure',NULL,'Jesse has disappeared and Walt is in big trouble with Gus. So Gus rehires Gale to learn from Walt\'s cooking so that they can dispose of Walt once and for all.',NULL),('b6f011caf4141f05b8e7d29814348732','b01db29057d991f5264909be33b34419',7,'Before a Fall',NULL,'With the Continent at risk from Nilfgaard\'s rising power, Yennefer revisits her past, while Geralt reconsiders his obligation to the Law of Surprise.',NULL),('7c707671b4d78ee52845e4f99ed2451d','b021e87cf2bdf1e2a43a2276326a7a99',7,'Say My Name',NULL,'Mike and Jesse are out. Now Walt has to handle things on his own. Hank finally finds a rat in Mike\'s gang.',NULL),('8306799d1deead7f0e0505118a8d861f','b04f1a6dac28b5567c7b1f7d4b8c787c',7,'The Claw of Shame',NULL,'In this special episode, Nathan performs a daring escape in which he risks a fate that is truly worse than death, and failed business ideas from the season are showcased.',NULL),('0539233281207ccb85774270be7723e8','b0762a23fcd08ddf6039a5fde7b6408e',3,'Ruminations: Big and Little Bullys',NULL,'Rue pursues a new business venture as she helps forge a friendship between Jules and Elliot. Cassie settles into a routine, while Lexi pours herself into mounting a school play. Maddy considers getting back together with Nate, and Cal finds a target.',NULL),('f5725c07d1082b0a4d5780e144418a39','b0c0e2f0ce2014329202e319f2410a0a',3,'Episode 3',NULL,'Tommy travels to Wale