sse is hooked on heroin, Walt refuses to give him his money until he gets clean. Meanwhile, as an excuse for his money, Walt decides to donate the money to himself through his son\'s new website.',NULL),('f13fa9d7506235f6160792767834cf4a','b8c951902ec68a33d5e87eeb8246e84d',4,'Sporting Goods Store/Antique Store',NULL,'Nathan attempts to secure an endorsement deal for a sporting-goods store, and an antique shop learns how to better utilize their \"You break it, you buy it\" policy.',NULL),('c4c9fcd5c34aeccfa6c9a847d9c8f179','b9c1d2edf426d341788d27a64ed2644e',1,'Chapter One: The Hellfire Club',NULL,'Still reeling from the events last year, the gang tries to move on with their lives. However, a threat is brewing both on Earth and the Upside Down.',NULL),('9f46394252e21a14fcfacf1d5fce8c5b','b9f18d12d638f96199f7bdb7d103c0d9',5,'The Best Revenge Is Dressing Well',NULL,'Blackbeard and Stede attend a fancy party. Oluwande and Frenchie embrace false identities. Izzy and Lucius go head-to-head.',NULL),('c91cf3f2f7d00f77450b4dd2b5fb3c6b','ba00b5fb71c60c8bdeb4c81172b9e148',4,'Green Light',NULL,'Walt\'s world crumbles even more after finding out that Skyler is cheating on him. Jesse tries to set up a meeting with Gus to try and sell his own version of the blue meth. Meanwhile, Hank is growing obsessed with finding Heisenberg.',NULL),('39a7a77ddda8f50369ff912f3da245f8','ba88ba9127a924fea64eef67538aee92',7,'Chapter Seven: The Lost Sister',NULL,'Psychic visions draw Eleven to a band of violent outcasts and an angry girl with a shadowy past.',NULL),('39fd70e7880c97d1d311085a9979f935','bac3d06d4feb31366e89fd2ddeac269f',5,'The Birthplace of Civilization',NULL,'The Smutnys receive unexpected guests, Josto and Gaetano reunite, Loy challenges the status quo and Oraetta is caught.',NULL),('c25d88acc0a04d27318f4bf425f9619e','baef3bb2a2d3f4cf421e626885fefcd3',8,'And Salt the Earth Behind You',NULL,'It\'s the winter formal at East Highland.',NULL),('39fd70e7880c97d1d311085a9979f935','bbd849d7