ampaign tour.',NULL),('840667b03aff464c64f8f35024f0a38e','ebb89e6a0dba0c5bfd8ea414766e7bb1',5,'Metalhead',NULL,'In the post-apocalyptic landscape of the Scottish Moors, a woman attempts to survive the land full of \"dogs.\"',NULL),('4f9a710a1cff57ba5c0990658f9b0be7','ebd5ec24d48f848700f0b8a18382d371',6,'Buridan\'s Ass',NULL,'Malvo executes his master plan, while Lester attempts to craft one of his own. Gus and Molly team up in Duluth.',NULL),('854212de47a60a6be3fd2d69e50af097','ec55d6c04a1939abad38dffc12addd00',6,'Chapter Six: E Pluribus Unum',NULL,'Dr. Alexei reveals what the Russians have been building, and Eleven sees where Billy has been. Dustin and Erica stage a daring rescue.',NULL),('8306799d1deead7f0e0505118a8d861f','eceabaf3f1a9bbd23e17748a813d0b4c',6,'Funeral Home/Burger Joint/Skydiving',NULL,'Nathan helps a struggling funeral home, a burger joint is forced to stand by its claim that it has the best burger in Los Angeles, and Nathan goes skydiving.',NULL),('566e97f614b0f7b199b49d683db70b4f','ed3acdbb7631fbbc5124da577c35797c',9,'La Catedral',NULL,'The hunt for Pablo seems to be over after he makes a deal with the government, but Murphy and Pe√±a - and the Cali Cartel - have other plans.',NULL),('bf76833270b962848eb653306a985457','ede84ff8edeee7485d9cd8641b6d016c',4,'Episode 4',NULL,'A conflict at the border shifts the dynamics within Yohan\'s inner circle. Sangman proposes a different route to Korea.',NULL),('5815d1e65566e71e538f3a13dd26044e','ee29179978bd10cd714c4fac507e38be',8,'Convivir',NULL,'David seeks revenge on behalf of his father and puts Enrique in danger. Pe√±a asks Don Berna for help on a rescue mission.',NULL),('eeb2756a3a939197c08f0289046fb8b4','ee4eb8d602cd98427f1f265afddfbbcb',1,'Mechanic; Realtor',NULL,'Nathan convinces a mechanic to verify his estimates with a polygraph test, and rebrands a realtor to sell only ghost-free homes.',NULL),('bc2eecc49090d5ad6e79ba33992819ba','ef5c36991eb749262d403c63c8e5cebb',8,'The Last Patrol',NULL,'Easy Company is in Hagenau in Feburary 1945, where they prepare for a night patrol mission to capture German prisoners. The patrol includes one veteran who is despised for missing Bastogne and a new lieutenant fresh out of West Point.',NULL),('83260b357055283208bf5978182c2400','f0bf3fc137a403c47167dbfc015a2320',4,'Tonight We Improvise',NULL,'Marty hires Ruth to pull off a heist. Agent Petty forges a relationship with a member of the Langmore family. Jonah exhibits disturbing behavior.',NULL),('c4c9fcd5c34aeccfa6c9a847d9c8f179','f0c814fcd2ce687f5c8aa2a8dac46474',4,'Chapter Four: Dear Billy',NULL,'Max is in grave danger - and running out of time. A patient at Pennhurst asylum has visitors. Elsewhere, in Russia, Hopper is hard at work.',NULL),('ba6929a18653f4f28071a40ac01bb12b','f14b6eb59b1a36798bd274d9aa97fa39',4,'Andy vs. Uber',NULL,'Nathan teams up with a struggling taxi driver to take down Uber.',NULL),('c4c9fcd5c34aeccfa6c9a847d9c8f179','f21ba1e083e483690239246b7f1ba522',5,'Chapter Five: The Nina Project',NULL,'Owens takes El to Nevada, where she\'s forced to confront her past, while the Hawkins kids comb a crumbling house for clues. Vecna claims another victim.',NULL),('f85f6b899d33bf709ff00c36e919a23c','f28d5af3e63e74b46d468ae915c956d2',10,'State of Play',NULL,'The Don\'t Bothers are forced to choose what\'s really important, as they face the Ducks at States.',NULL),('566e97f614b0f7b199b49d683db70b4f','f2a1ad91eae05a1e71d9466e5a12d02c',8,'La Gran Mentira',NULL,'A tragic mistake forces the government to change tactics in the fight against Pablo. But Pablo faces bigger threats from inside his empire.',NULL),('08728cb33e50d52cf2114169b21cc549','f3dbd2087ee97aef2574582ded0cb572',4,'Where Are All the Monsters?',NULL,'Cricket is stuck at home for Halloween with a new Broken Karaoke cover.',NULL),('39fd70e7880c97d1d311085a9979f935','f482d4c52d5e498a1e12cf0de7496578',2,'The Land of Taking and Killing',NULL,'The Smutnys receive unexpected guests, Josto and Gaetano reunite, Loy challenges the status quo, and Oraetta is caught.',NULL),('bcb1698c4ad595eabff5c9662b05c401','f486c014e6a21790b37e474f193a1021',6,'Rhinoceros',NULL,'With Ed and Charlie in custody, the Gerhardts arrive at the police station, forcing Lou and Hank to try and prevent any more bloodshed.',NULL),('04aea369458f234ff90282a5d44b02aa','f4df0997a3e6a78a4b41422a77aea8ed',5,'We Gotta Go Now',NULL,'Butcher has no more intentions to fight with Supes but Black Noir traced his location and found him: what will he do now? Supes are shooting a film named - #Dawn Of The Seven. Homelander is doing what Stormfront told him to do.',NULL),('83260b357055283208bf5978182c2400','f502effcc72cf2068eda5715a6df139d',1,'Sugarwood',NULL,'After his business partner cheats a dangerous client, financial adviser Marty must devise a radical plan to save the lives of himself and his family.',NULL),('009f95053725376a106448e59d30269c','f5a58c18c84cc51dc6cdcaea7a430204',6,'All for Nothing',NULL,'Beth reveals a secret to her father; John confronts two cowboys about old feuds; a search gets underway on the reservation.',NULL),('0539233281207ccb85774270be7723e8','f64436d5943d124fe65ffbc2f1b01e65',1,'Trying to Get to Heaven Before They Close the Door',NULL,'Rue and Jules cross paths for the first time since Christmas as East Highland rings in the new year.',NULL),('39fd70e7880c97d1d311085a9979f935','f66f22df518a5b0a31abfd09cf509454',4,'The Pretend War',NULL,'Loy retaliates, Josto asserts his leadership, Ethelrida makes a disturbing discovery, and the walls begin to close in on Odis.',NULL),('864b6575289716760a6f745ce5ba6a4e','f756bead38440b25bb1ee279ea3623e0',6,'Dear Friend...',NULL,'A close friend is lost - and another found - as Geralt helps Ciri learn more about her power. Cahir warns Fringilla to focus on their primary mission.',NULL),('1fd7fce069b3d48994b672c87f5e19ac','f77bc249e2eebc33674ccfba657182ce',3,'Coach Classic',NULL,'The annual Coach Classic, where coaches take the ice against kids, leads to big drama at EPIC.',NULL),('b6f011caf4141f05b8e7d29814348732','f7a2598f6812dd246a3aebb013741732',4,'Of Banquets, Bastards and Burials',NULL,'Against his better judgment, Geralt accompanies Jaskier to a royal ball. Ciri wanders into an enchanted forest. Yennefer tries to protect her charges.',NULL),('854212de47a60a6be3fd2d69e50af097','f8b92e9ff6ba3d73de661563c42c1e06',3,'Chapter Three: The Case of the Missing Lifeguard',NULL,'With El and Max looking for Billy, Will declares a day without girls. Steve and Dustin go on a stakeout, and Joyce and Hopper return to Hawkins Lab.',NULL),('25161b9cae1d307efba2beeb35ee793c','f91c57c0a649865fae319a6a485013cd',8,'The Dawning',NULL,'Suzanne follows Mae to the Amontown compound, where the Dodd family and their followers prepare for a deadly ritual. The Mathises seek a fresh start.',NULL),('c4c9fcd5c34aeccfa6c9a847d9c8f179','f92e6d59a04ac3d9bc340277a5ac58b2',3,'Chapter Three: The Monster and the Superhero',NULL,'Murray and Joyce fly to Alaska, and El faces serious consequences. Robin and Nancy dig up dirt on Hawkins\' demons. Dr. Owens delivers sobering news.',NULL),('07a0418dfd5c8288771cd59f76b18479','f9def99585d26e1bafc7bcb3083f1157',4,'Deserts',NULL,'The world\'s deserts force animals to come up with ingenious ways of coping with hostile conditions, giving rise to the most incredible survival stories on earth.',NULL),('e2ac8ed4d6497359255904150147a1be','fa8d29cd57fa271f7ead8b420c554e5d',5,'This Is Our House',NULL,'Louise\'s dad is arrested. Louise and Olive get caught cheating on a test. Marvyn starts dating again.',NULL),('68ab79f804bcd3623fb9a784e8b0cfa4','fb2df2558ed58e987fbe8924c8ec42b8',1,'Strange Relations',NULL,'Discover how animals use secret powers to form unexpected alliances.',NULL),('e2ac8ed4d6497359255904150147a1be','fb453acb2f472dc0e580a49f05338643',1,'Pilot',NULL,'After being ousted from NCAA, a men\'s basketball coach takes a job at an elite private high school.',NULL),('c1ce9516f6bd3a58609d8fba23f661ca','fb8186825a4b9416ec37d2e7dcc80ba5',8,'Chapter Eight: The Upside Down',NULL,'Joyce and Hopper are taken in for questioning. Nancy and Jonathan prepare to fight the monster and save Will.',NULL),('39f97d525dd13b2711a1bbabbb2c42d8','fbf674663222b6e81dc812357b80eea0',7,'Sanctified',NULL,'The FBI\'s long-awaited meeting with Omar takes place. Wyatt shares some news with Ruth. Feeling betrayed, Javi gets aggressive.',NULL),('c91cf3f2f7d00f77450b4dd2b5fb3c6b','fbf9cd58ff6f92680f3619f62c89c9f9',12,'Half Measures',NULL,'Against Walt\'s advice, Jesse lashes out. Fearing for Jesse\'s safety, Walt takes drastic action to intervene. Meanwhile a tragic event leads to a shocking confrontation.',NULL),('39fd70e7880c97d1d311085a9979f935','fc49240e0b4ac4750c79a7951d9b5f38',1,'Welcome to the Alternate Economy',NULL,'The head of an African American crime syndicate goes to war with the Italian mafia in Kansas City, Missouri during the 1950s.',NULL),('8306799d1deead7f0e0505118a8d861f','fc678a5e1559f685995cdd784fcac38d',5,'Haunted House/The Hunk',NULL,'Nathan tries to help a struggling haunted house. He also attempts to overcome his fear of the opposite sex by dating ten women at once.',NULL),('f1646747551e0f7d91a641448aefd117','fc9848efb626e6625bdc486d6319b6fe',7,'Problem Dog',NULL,'Skyler looks to continue her family\'s trend of appearing poverty-stricken by forcing Walt to return the car he bought. A concerned Walt chauffeurs Hank to Los Pollos Hermanos, and the articulate yet immobile DEA agent collects prints.',NULL),('39f97d525dd13b2711a1bbabbb2c42d8','fe719ba79e489d7a83aa57fa5378eb65',1,'The Beginning of the End',NULL,'Marty and Wendy wrestle with a problematic offer. Ruth goes out on her own, Jonah rebels, and Omar\'s nephew makes his presence known.',NULL),('0539233281207ccb85774270be7723e8','ff23620dc0b2d96ce66781a990f3ba8f',8,'All My Life, My Heart Has Yearned for a Thing I Cannot Name',NULL,'Snippets of memory collide with the present and future.',NULL),('39f97d525dd13b2711a1bbabbb2c42d8','ff6f75777e77809d2c15cda807105c27',12,'Trouble the Water',NULL,'Nathan angers Wendy by making Charlotte and Jonah a surprising offer. Ruth tries to erase her own past with an assist from Charles Wilkes.',NULL),('39fd70e7880c97d1d311085a9979f935','ff9f4e1d72d61d7b3e9a9f7d36802306',11,'Storia Americana',NULL,'Josto gets revenge, Oraetta comes clean and Ebal teaches Loy a lesson about business.',NULL),('04aea369458f234ff90282a5d44b02aa','ffc891c8c49b92e97f6f8d731f8b6ba1',1,'The Big Ride',NULL,'With Butcher still missing, Hughie, Mother\'s Milk, Frenchie, and Kimiko are now fugitives, and Homelander and Vought are more powerful than ever. But just as the Boys are about to leave the country, they are pulled back into the fray.',NULL);
