INSERT INTO `titles` VALUES ('0bbffa8cca43b958b81fdf60ea2a302c','Yellowstone',NULL,'bd05c437c7220323136e6f6d9c27b3c6','TV-MA',NULL,'A ranching family in Montana faces off against others encroaching on their land.','https://www.imdb.com/title/tt4236770','8.7','https://www.rottentomatoes.com/tv/yellowstone','83%'),('0d7a0ef03d5014d1842ea41a92933e15','Avengers: Endgame',NULL,'2d31d471f09e2f29f208156327acbeac','PG-13',NULL,'After the devastating events of Avengers: Infinity War (2018), the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to reverse Thanos\' actions and restore balance to the universe.','https://www.imdb.com/title/tt4154796','8.4','https://www.rottentomatoes.com/m/avengers_endgame','94%'),('10fa17ca9157be44959290f3f892aab6','The Witcher',NULL,'46cbb94d3b08d1a7b33a864b3069dc6d','TV-MA',NULL,'Geralt of Rivia, a solitary monster hunter, struggles to find his place in a world where people often prove more wicked than beasts.','https://www.imdb.com/title/tt5180504','8.2','https://www.rottentomatoes.com/tv/the_witcher','81%'),('119ab2cec8cec6ed8a7d040bc2a0dd9b','The French Dispatch',NULL,'a7f6968dee06043125d3144082bf5792','R',NULL,'A love letter to journalists set in an outpost of an American newspaper in a fictional twentieth century French city that brings to life a collection of stories published in \"The French Dispatch Magazine\".','https://www.imdb.com/title/tt8847712/','7.2','https://www.rottentomatoes.com/m/the_french_dispatch','75%'),('159a8523f8c1c3e63fa1acd571e5e707','Spies in Disguise',NULL,'da2931baf707bb014a077036bb59a895','PG',NULL,'When the world\'s best spy is turned into a pigeon, he must rely on his nerdy tech officer to save the world.','https://www.imdb.com/title/tt5814534/','6.8','https://www.rottentomatoes.com/m/spies_in_disguise','77%'),('1812e09b727ccd504958b4b45c091b83','The Shawshank Redemption',NULL,'3948a009c10c272fcc770643e1f28c06','R',NULL,'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.','https://www.imdb.com/title/tt0111161/','9.3','https://www.rottentomatoes.com/m/shawshank_redemption','91%'),('1a93573058112f572f2eedf660ae3caa','The Rehearsal',NULL,'08479238349c0ad801415616c0c2ad97','TV-MA',NULL,'Nathan Fielder gives people a chance to rehearse for their own lives in a world where nothing ever works out as expected.','https://www.imdb.com/title/tt10802170','9.0','https://www.rottentomatoes.com/tv/the_rehearsal_2022','94%'),('1b1416d0e88fd7094199f31b1ab572f9','Ozark',NULL,'9235ed8fd378deb1157ea5b1f8ac0263','TV-MA',NULL,'A financial advisor drags his family from Chicago to the Missouri Ozarks, where he must launder money to appease a drug boss.','https://www.imdb.com/title/tt5071412','8.5','https://www.rottentomatoes.com/tv/ozark','82%'),('2174082db9b8df9524f6874064427fd5','The Mighty Ducks: Game Changers',NULL,'3de399bcc30f967de679c92dd96def7e','TV-PG',NULL,'After failing to make the cut to join the now powerhouse Mighty Ducks junior hockey team, 12-year-old Evan\'s mother encourages him to form a new team of underdogs with help from Gordon Bombay, the Ducks\' original coach.','https://www.imdb.com/title/tt7939768/','7.4','https://www.rottentomatoes.com/tv/the_mighty_ducks_game_changers','87%'),('2373636dca8f358355a26398e6d8412a','Big Shot',NULL,'69b7b05f1472c233d6040da2e780bb65','TV-PG',NULL,'A temperamental college basketball coach who gets fired from his job and must take a teaching and coaching job at an elite all-girls private high school.','https://www.imdb.com/title/tt11238096/','7.5','https://www.rottentomatoes.com/tv/big_shot','78%'),('2813a97975766c07dd5b1e40e10e1544','The Peanuts Movie',NULL,'d661ba5ea012888eeb3d9105087da153','G',NULL,'Snoopy embarks upon his greatest mission as he and his team take to the skies to pursue their archnemesis, while his best pal Charlie Brown begins his own epic quest back home to win the love of his life.','https://www.imdb.com/title/tt2452042/','7.0','https://www.rottentomatoes.com/m/the_peanuts_movie','87%'),('28b43e54887abbe25867a143ffce26e0','Breaking Bad',NULL,'40ee03823bc8c3dab09b38cc91b6e84c','TV-MA',NULL,'A high school chemistry teacher diagnosed with inoperable lung cancer turns to manufacturing and selling methamphetamine in order to secure his family\'s future.','https://www.imdb.com/title/tt0903747','9.5','https://www.rottentomatoes.com/tv/breaking_bad','96%'),('2e1a8f340217d8548846726172ce2e7f','The Wolf of Wall Street',NULL,'9889324c50ac6e71de3ad2416a05cb21','R',NULL,'Based on the true story of Jordan Belfort, from his rise to a wealthy stock-broker living the high life to his fall involving crime, corruption and the federal government.','https://www.imdb.com/title/tt0993846','8.2','https://www.rottentomatoes.com/m/the_wolf_of_wall_street_2013','80%'),('3468952ada39e019cc4380c04a918190','Collateral',NULL,'c0286cbe65a30718b647fab55e8d75ab','R',NULL,'A cab driver finds himself the hostage of an engaging contract killer as he makes his rounds from hit to hit during one night in Los Angeles.','https://www.imdb.com/title/tt0369339/','7.5','https://www.rottentomatoes.com/m/collateral','86%'),('352455fa31c714f47b40dd3e38e4fa95','The Champion',NULL,'5e89e80985f93d36812a5250261d6110','TV-MA',NULL,'The story of the pre-war boxing champion Tadeusz \"Teddy\" Pietrzykowski, who in 1940 arrives with the first transport of prisoners to the newly created Auschwitz concentration camp.','https://www.imdb.com/title/tt11369540/','6.6','https://www.rottentomatoes.com/m/the_champion_of_auschwitz',''),('38052fd261d5c605fc92e966ad9e2b27','The Godfather',NULL,'691b9132c92162b4fd37f628e1500c75','R',NULL,'The aging patriarch of an organized crime dynasty in postwar New York City transfers control of his clandestine empire to his reluctant youngest son.','https://www.imdb.com/title/tt0068646/','9.2','https://www.rottentomatoes.com/m/the_godfather','97%'),('41872d24e7ad66153d189007ab7584dd','Andor',NULL,